package Operators;

public class RelationalOperator {
static int a=5,b=10;
	public static void main(String[] args) {
		// TODO Auto-generated method stub
if(a>=b) {
	System.out.println("a is greater than or equal to b "+a );
}
else if(a<=b) {
	System.out.println("b is greater than or equal to a "+b );
	
}
else if(a==b) {
	System.out.println("a is  equal to b "+a );
	
}
else if(a!=b) {
	System.out.println("a is not equal to b "+a );
}


	}

}
